INSERT INTO `dynaPageCommandData` VALUES (1,'getLastTillOperation','getLastTillOperation',0,'if(vm.tillData && vm.tillData[0]){\r\n	let lastTillOperationDetails = vm.getLastTillOperation(vm.tillData[0], vm.db);\r\n	logService.setlog([\"lastTillOperationDetails\", {lastTillOperationDetails:lastTillOperationDetails, tillData: vm.tillData}], \"debug\");\r\n	if(lastTillOperationDetails && lastTillOperationDetails.length){\r\n		lastTillOperationDetails = lastTillOperationDetails[0];\r\n		if(lastTillOperationDetails.tillOperation_tillOperationType && lastTillOperationDetails.tillOperation_tillOperationType != \'open\'){\r\n			$state.go(\"dynaPage\", { \"pageCode\": \"tillOperation\"});\r\n		}\r\n	}else{\r\n		logService.setlog([\"Till operation could not be fetched. last Till Operation details are as follow\", lastTillOperationDetails], \"warning\");\r\n		$state.go(\"dynaPage\", { \"pageCode\": \"tillOperation\"});\r\n	}\r\n}else{\r\n	logService.setlog([\"Till data could not be fetched. last Till Operation details are as follow\", vm.tillData], \"warning\");\r\n	$state.go(\"dynaPage\", { \"pageCode\": \"tillOperation\"});\r\n}','','local','shell','2019-07-28 05:47:20','',''),(2,'itemsImport','itemsImport',0,'SELECT itemsDetail.itemId AS `itemsDetail_itemId`, itemsDetail.itemName AS `itemsDetail_itemName`, itemsDetail.itemCode AS `itemsDetail_itemCode`, itemsDetail.itemBarcode AS `itemsDetail_itemBarcode`, itemsDetail.itemExternalId AS `itemsDetail_itemExternalId`, itemsDetail.itemDescription AS `itemsDetail_itemDescription`, itemsStatus.status AS `itemsStatus_status`, itemsIdbrandsId.brandId AS `itemsIdbrandsId_brandId`, itemsIdbrandsId.status AS `itemsIdbrandsId_status`, brandsStatus.status AS `brandsStatus_status` ,\r\nCONCAT(\r\n	\'[\',\r\n        COALESCE(\r\n            GROUP_CONCAT(\r\n                DISTINCT(CONCAT(\r\n                    \'{\',\r\n	                    \'\\\"itemsPrice_price\\\": \\\"\', itemsPrice.price, \'\\\", \',\r\n	                    \'\\\"itemsPrice_currencyId\\\": \\\"\', itemsPrice.currencyId, \'\\\"\',\r\n                    \'}\') \r\n                ) \r\n                SEPARATOR \',\'),\r\n		\'\'),\r\n	\']\'\r\n) AS `itemPrice` \r\n\r\nFROM itemsDetail \r\nLEFT JOIN itemsDetail AS itemsDetail2 ON itemsDetail.itemId = itemsDetail2.itemId AND itemsDetail2.onlineInsertTime > itemsDetail.onlineInsertTime \r\n\r\nINNER JOIN itemsStatus ON itemsStatus.itemId = itemsDetail.itemId \r\nLEFT JOIN itemsStatus AS itemsStatus2 ON itemsStatus2.itemId = itemsStatus.itemId AND itemsStatus2.onlineInsertTime > itemsStatus.onlineInsertTime \r\n\r\nLEFT JOIN itemsIdbrandsId ON itemsIdbrandsId.itemId = itemsDetail.itemId \r\nLEFT JOIN itemsIdbrandsId AS itemsIdbrandsId2 ON itemsIdbrandsId.itemId = itemsIdbrandsId2.itemId AND itemsIdbrandsId.brandId = itemsIdbrandsId2.brandId AND itemsIdbrandsId2.onlineInsertTime > itemsIdbrandsId.onlineInsertTime \r\n\r\nLEFT JOIN brandsStatus ON brandsStatus.brandId = itemsIdbrandsId.brandId \r\nLEFT JOIN brandsStatus AS brandsStatus2 ON brandsStatus2.brandId = brandsStatus.brandId AND brandsStatus2.onlineInsertTime > brandsStatus.onlineInsertTime \r\n\r\nLEFT JOIN itemsPrice ON itemsPrice.itemId = itemsDetail.itemId \r\nLEFT JOIN itemsPrice AS itemsPrice2 ON itemsPrice2.itemId = itemsPrice.itemId AND itemsPrice2.currencyId = itemsPrice.currencyId AND itemsPrice2.onlineInsertTime > itemsPrice.onlineInsertTime \r\n\r\nWHERE itemsDetail2.itemId IS NULL AND itemsStatus2.itemId IS NULL AND (itemsIdbrandsId.itemId IS NULL OR (itemsIdbrandsId.itemId IS NOT NULL AND itemsIdbrandsId2.itemId IS NULL)) AND itemsIdbrandsId2.itemId IS NULL\r\n	AND (brandsStatus.id IS NULL OR (brandsStatus.id IS NOT NULL AND brandsStatus2.id Is NULL) AND brandsStatus2.id IS NULL) \r\n	AND (itemsPrice.itemId IS NULL OR (itemsPrice.itemId IS NOT NULL AND itemsPrice2.itemId IS NULL AND itemsPrice.status = 1)) \r\n	\r\n	AND ( \r\n			(itemsDetail.onlineInsertTime >= STR_TO_DATE(:onlineInsertTime_itemDetails, \'%Y-%m-%d %H:%i:%s\')) \r\n		OR \r\n			((itemsStatus.onlineInsertTime) >= STR_TO_DATE(:onlineInsertTime_itemsStatus, \'%Y-%m-%d %H:%i:%s\')) \r\n		OR \r\n			((itemsIdbrandsId.onlineInsertTime) >= STR_TO_DATE(:onlineInsertTime_itemsIdbrandsId, \'%Y-%m-%d %H:%i:%s\')) \r\n		OR \r\n			((itemsPrice.onlineInsertTime) >= STR_TO_DATE(:onlineInsertTime_itemsPrice, \'%Y-%m-%d %H:%i:%s\')) \r\n	) \r\n	\r\n	AND FIND_IN_SET(itemsIdbrandsId.brandId, :brandsId) \r\n	\r\nGROUP BY itemsDetail.itemId ','[\r\n	{\"name\":\"brandsId\",\"type\":\"a\"}, \r\n	{\"name\":\"onlineInsertTime_itemDetails\",\"type\":\"s\"},\r\n	{\"name\":\"onlineInsertTime_itemsStatus\",\"type\":\"s\"},\r\n	{\"name\":\"onlineInsertTime_itemsIdbrandsId\",\"type\":\"s\"},\r\n	{\"name\":\"onlineInsertTime_itemsPrice\",\"type\":\"s\"}\r\n]','server','sql','2018-05-22 01:53:12','',''),(3,'tillSettingsImport-settings','tillSettingsImport',0,'SELECT \r\ntillsDetail.tillId AS `tillsDetail_tillId`, \r\ntillsDetail.tillNumber AS `tillsDetail_tillNumber`, \r\ntillsDetail.tillCode AS `tillsDetail_tillCode`, \r\ntillsDetail.storeId AS `tillsDetail_storeId`, \r\ntillsStatus.status AS `tillsStatus_status`, \r\nstoresDetail.storeCode AS `storesDetail_storeCode`, \r\nstoresDetail.storeName AS `storesDetail_storeName`, \r\nstoresStatus.status AS `storesStatus_status` , \r\nCONCAT(\r\n	\'[\',\r\n        COALESCE(\r\n            GROUP_CONCAT(\r\n                DISTINCT(CONCAT(\r\n                    \'{\',\r\n	                    \'\\\"storesIdbrandsId_brandId\\\": \\\"\', storesIdbrandsId.brandId, \'\\\", \',\r\n	                    \'\\\"storesIdbrandsId_status\\\": \\\"\', storesIdbrandsId.status, \'\\\"\',\r\n                    \'}\') \r\n                ) \r\n                SEPARATOR \',\'),\r\n		\'\'),\r\n	\']\'\r\n) AS `storeBrands` \r\n\r\nFROM tillsDetail \r\nLEFT JOIN tillsDetail AS tillsDetail2 ON tillsDetail.tillId = tillsDetail2.tillId AND tillsDetail2.onlineInsertTime > tillsDetail.onlineInsertTime \r\n\r\nINNER JOIN tillsStatus ON tillsStatus.tillId = tillsDetail.tillId \r\nLEFT JOIN tillsStatus AS tillsStatus2 ON tillsStatus2.tillId = tillsStatus.tillId AND tillsStatus2.onlineInsertTime > tillsStatus.onlineInsertTime \r\n\r\nINNER JOIN storesDetail ON storesDetail.storeId = tillsDetail.storeId \r\nLEFT JOIN storesDetail AS storesDetail2 ON storesDetail2.storeId = storesDetail.storeId AND storesDetail2.onlineInsertTime > storesDetail.onlineInsertTime\r\n\r\nINNER JOIN storesStatus ON storesStatus.storeId = storesDetail.storeId \r\nLEFT JOIN storesStatus AS storesStatus2 ON storesStatus.storeId = storesStatus2.storeId AND storesStatus2.onlineInsertTime > storesStatus.onlineInsertTime\r\n\r\nLEFT JOIN storesIdbrandsId ON storesIdbrandsId.storeId = tillsDetail.storeId \r\nLEFT JOIN storesIdbrandsId AS storesIdbrandsId2 ON storesIdbrandsId.storeId = storesIdbrandsId2.storeId AND storesIdbrandsId.brandId = storesIdbrandsId2.brandId AND storesIdbrandsId2.onlineInsertTime > storesIdbrandsId.onlineInsertTime \r\n\r\nWHERE tillsDetail2.tillId IS NULL AND tillsStatus2.tillId IS NULL AND storesDetail2.storeId IS NULL AND storesStatus2.storeId IS NULL \r\nAND (storesIdbrandsId.storeId IS NULL OR (storesIdbrandsId.storeId IS NOT NULL AND storesIdbrandsId2.storeId IS NULL AND storesIdbrandsId.status=1))\r\nAND (tillsDetail.onlineInsertTime > :onlineInsertTime_tillsDetail OR tillsStatus.onlineInsertTime > :onlineInsertTime_tillStatus OR \r\nstoresDetail.onlineInsertTime > :onlineInsertTime_storesDetail OR storesStatus.onlineInsertTime > :onlineInsertTime_storesStatus OR \r\nstoresIdbrandsId.onlineInsertTime > :onlineInsertTime_storesIdbrandsId) \r\nAND tillsDetail.tillId = :tillId \r\n\r\nGROUP BY tillsDetail.tillId\r\n','[\r\n	{\"name\":\"tillId\",\"type\":\"s\"}, \r\n	{\"name\":\"onlineInsertTime_storesDetail\",\"type\":\"s\"},\r\n	{\"name\":\"onlineInsertTime_tillsDetail\",\"type\":\"s\"},\r\n	{\"name\":\"onlineInsertTime_tillStatus\",\"type\":\"s\"},\r\n	{\"name\":\"onlineInsertTime_stores