INSERT INTO `dynaPageFunction` VALUES (1,'getCurrentTime','Window','[]','var requestTime = moment.utc().format(\"YYYY-MM-DD HH:mm:ss\");\r\n\r\nreturn requestTime','',0,'2018-06-26 02:13:22','',''),(2,'selectItem','Scope','[\r\n	{\r\n		\"name\": \"itemBarcode_itemCode\"\r\n	},\r\n	{\r\n		\"name\": \"rowEntity\"\r\n	},\r\n	{\r\n		\"name\": \"salesHeaderId\"\r\n	},\r\n	{\r\n		\"name\": \"options\"\r\n	}\r\n]','//selectItem\r\nitemBarcode_itemCode = itemBarcode_itemCode.toString();\r\nlet searchCondition = {\r\n	\'$or\': [{ \r\n		\'itemsDetail_itemBarcode\' : {\r\n			\'$eq\': itemBarcode_itemCode\r\n		}\r\n	},{\r\n		\'itemsDetail_itemCode\' : itemBarcode_itemCode\r\n	}]\r\n};\r\n	\r\nlet parameters = {\r\n	\"limit\": 1,\r\n	\"sortBy\": \"$loki\",\r\n	\"sortIsDesc\": true\r\n};\r\n\r\nvar itemDetails = localDb.advancedSelectItem(\"itemsDetail\", searchCondition, options.db, parameters);\r\nif(itemDetails.length && itemDetails[0]){\r\n	angular.extend(rowEntity, itemDetails[0]);\r\n	vm.selectItemPrice(rowEntity, \"itemsPrice\");\r\n	if(!rowEntity.salesItem_quantity){\r\n		rowEntity.salesItem_quantity = 1;\r\n	}\r\n	rowEntity.salesItem_afterDiscount = priceRounding.round(parseFloat(rowEntity.salesItem_quantity) * parseFloat(rowEntity.itemsPrice_price));\r\n	rowEntity.salesItem_scanTime = getCurrentTime();\r\n	rowEntity.salesItem_offlineSalesItemId = guid.newuuid(\'salesHeaderId\');\r\n	rowEntity.salesItem_salesHeaderId = salesHeaderId;\r\n	vm.gotoNextLine(options.db);\r\n}\r\nlet footerData = vm.makeFooter({receipt: vm.data[0], tillData: vm.tilldata});\r\nvm.data[0].total = footerData.total;\r\nvm.data[0].salesTax = footerData.salesTax;\r\nreturn {line:rowEntity, receipt:vm.data[0]};','',0,'2019-07-30 16:20:29','',''),(3,'selectItemPrice','Scope','[\r\n	{\r\n		\"name\": \"rowEntity\"\r\n	},\r\n	{\r\n		\"name\":\"priceField\", \r\n		\"default\":\"itemPrice\"\r\n	}\r\n]','//selectItemPrice\r\nlet rowEntityCopy1 = angular.copy(rowEntity);\r\nlogService.setlog([\"selected item price start\",{rowEntity:rowEntityCopy1}], \"debug\");\r\nlet itemsPrice_price = rowEntity[priceField].find(price => price.itemsPrice_currencyId == (rowEntity.itemsPrice_currencyId || \"CAD\"));\r\n\r\nif(itemsPrice_price){\r\n	rowEntity.itemsPrice_price = priceRounding.round(parseFloat(itemsPrice_price[\'itemsPrice_price\']));\r\n	rowEntity.itemsPrice_currencyId = itemsPrice_price[\'itemsPrice_currencyId\'];\r\n}\r\n\r\nlet rowEntityCopy2 = angular.copy(rowEntity);\r\nlogService.setlog([\"selected item price end\",{itemsPrice_price:itemsPrice_price, rowEntity:rowEntityCopy2}], \"debug\");','',0,'2019-07-30 18:06:16','',''),(4,'addDiscount','Scope','[\r\n	{\r\n		\"name\": \"options\",\r\n		\"default\": {}\r\n	}\r\n]','//addDiscount\r\nlet newDiscount;\r\nif(options.amount || options.percent || options.discountType){\r\n	if(!options.discountType || options.discountType==\"item\"){\r\n		//When discount is applied on line\r\n		let maxAllowedAmount = priceRounding.round(parseFloat(options.saleItem.salesItem_afterDiscount) / parseFloat(options.saleItem.salesItem_quantity));\r\n		//let maxAllowedPercent = maxAllowedAmount * 100/(priceRounding.round(parseFloat(options.saleItem.itemsPrice_price)));\r\n		\r\n		let basePrice = priceRounding.round(parseFloat(options.saleItem.salesItem_afterDiscount) / parseFloat(options.saleItem.salesItem_quantity));\r\n		if(options.basePrice){\r\n			basePrice = options.basePrice;\r\n		}\r\n		let benefitOrder = options.saleItem.salesItem_discount.length;\r\n\r\n		newDiscount = {\r\n			salesItem_offlineSalesItemId: options.saleItem.salesItem_offlineSalesItemId,\r\n			salesItemDiscount_basePrice: parseFloat(basePrice),\r\n			salesItemDiscount_precent: Math.floor(options.percent)  || 0,\r\n			salesItemDiscount_amount: priceRounding.round(Math.min(options.amount, maxAllowedAmount)) || 0,\r\n			salesItemDiscount_markdownId: options.markdownId || \'\',\r\n			salesItemDiscount_markdownDescription: options.markdownDescription || \'\',\r\n			salesItem