ition minAmount\",{promotion: promotionsBenefitSorted[j], condition: promotionBenefitsArray.conditions[t], conditionValue: condition.conditionValue, discountConditionItemList:discountConditionItemList, totalAmountAfterDiscount:totalAmountAfterDiscount, applicableTimes_log:applicableTimes_log, applicableTimes_t:applicableTimes_t}], \"info\");\r\n										if(applicableTimes > 0){\r\n											temporaryApplyBenefit.push(\"minAmount\");\r\n										}\r\n									}\r\n									if(condition.conditionType == \"minCount\" && applicableTimes){\r\n										let totalQty = lodash.sumBy(discountConditionItemList, \"salesItem_quantity\");\r\n										let applicableTimes_t = Math.floor(parseFloat(totalQty)/parseFloat(condition.conditionValue));\r\n										if(applicableTimes_t < applicableTimes) {\r\n											applicableTimes = parseInt(applicableTimes_t);\r\n										}\r\n										logService.setlog([\"7-checking promotion condition minCount\",{promotion: promotionsBenefitSorted[j], condition: promotionBenefitsArray.conditions[t], conditionValue: condition.conditionValue, totalQty:totalQty, applicableTimes:applicableTimes}], \"info\");\r\n										if(applicableTimes > 0){\r\n											temporaryApplyBenefit.push(\"minCount\");\r\n										}\r\n									}\r\n									if(condition.conditionType == \"keywordList\" && applicableTimes){\r\n										logService.setlog([\"8-checking promotion condition minCount\",{promotion: promotionsBenefitSorted[j], condition: promotionBenefitsArray.conditions[t], conditionValue: condition.conditionValue, receitKeywords:options.receipts[receiptIndex].salesHeaderIdkeyword, applicableTimes:applicableTimes}], \"info\");\r\n										if(options.receipts[receiptIndex].salesHeaderIdkeyword.findIndex(keywordDetails=> condition.conditionValue.findIndex(keywordDetails.salesHeaderIdkeyword_keyword) > -1 ) > -1){\r\n											temporaryApplyBenefit.push(\"keywordList\");\r\n										}\r\n									}\r\n									if(condition.conditionType == \"applicableTimes\"){\r\n										let applicableTimes_t = parseInt(condition.conditionValue);\r\n										if(applicableTimes_t < applicableTimes){\r\n											applicableTimes = applicableTimes_t;\r\n										}\r\n										logService.setlog([\"9-checking promotion condition applicableTimes\",{promotion: promotionsBenefitSorted[j], condition: promotionBenefitsArray.conditions[t], conditionValue: condition.conditionValue, applicableTimes_t:applicableTimes_t, applicableTimes:applicableTimes}], \"info\");\r\n										if(applicableTimes > 0){\r\n											applyOnAllItems = 0;\r\n											temporaryApplyBenefit.push(\"applicableTimes\");\r\n										}\r\n									}\r\n									if(condition.conditionType == \"applicableOrder\"){\r\n										conditionOrderArray = condition.conditionValue.split(\" \");\r\n										logService.setlog([\"10-checking promotion condition applicableOrder\",{promotion: promotionsBenefitSorted[j], condition: promotionBenefitsArray.conditions[t], conditionValue: condition.conditionValue, conditionOrderArray:conditionOrderArray}], \"info\");\r\n										if(conditionOrderArray && conditionOrderArray[0] && (conditionOrderArray[1]==\"asc\" || conditionOrderArray[1] == \"desc\")){\r\n											temporaryApplyBenefit.push(\"applicableOrder\");\r\n										}\r\n									}\r\n								}\r\n								if(temporaryApplyBenefit.length == promotionBenefitsArray.conditions.length && applicableTimes){\r\n									applyBenefit = 1;\r\n								}\r\n								logService.setlog([\"11-Function name: applyDiscounts::Discount applicabale test ({promotion, temporaryApplyBenefit, applicableTimes})\", {promotion: promotionsBenefitSorted[j], temporaryApplyBenefit: temporaryApplyBenefit, promotionBenefitsArray:promotionBenefitsArray, applicableTimes: applicableTimes}], \"info\");\r\n							}\r\n							\r\n							//APPLY BENEFIT\r\n							if(applyBenefit){\r\n								let discountedItemList = options.receipts[receiptIndex].salesItem.filter(function(item){return (item.salesItem_qua