\r\n		font-size: 1em;\r\n		//background: #EEE;\r\n	}\r\n	#invoice-POS .service{border-bottom: 1px solid #000;}\r\n	#invoice-POS .item{width: 24mm;}\r\n	#invoice-POS .itemtext{font-size: 1em;}\r\n\r\n	#invoice-POS .legalcopy{\r\n		margin-top: 5mm;\r\n	}\r\n	.rotate {\r\n	  text-align: center;\r\n	  white-space: nowrap;\r\n	  vertical-align: middle;\r\n	  width: 1.5em;\r\n	}\r\n	.rotate div {\r\n		 -moz-transform: rotate(90.0deg);  /* FF3.5+ */\r\n		   -o-transform: rotate(90.0deg);  /* Opera 10.5 */\r\n	  -webkit-transform: rotate(90.0deg);  /* Saf3.1+, Chrome */\r\n				 filter:  progid:DXImageTransform.Microsoft.BasicImage(rotation=0.083);  /* IE6,IE7 */\r\n			 -ms-filter: \"progid:DXImageTransform.Microsoft.BasicImage(rotation=0.083)\"; /* IE8 */\r\n			 margin-left: -10em;\r\n			 margin-right: -10em;\r\n	}\r\n	.barcodeHolder .image img{\r\n		height: 8mm;\r\n	}\r\n	.barcodeHolder .text{\r\n		font-size: 0.5em;\r\n	}\r\n	@media print {\r\n		\r\n	}\r\n</style>\r\n\r\n<div id=\"invoice-POS\" style=\"font-size: 7mm;\">\r\n	<center calss=\"top\">\r\n		<div class=\"logo\">\r\n			<img src=\"/uploads/receipts/logo.png\" width=\"100\" />\r\n		</div>\r\n		<div layout=\"row\"> \r\n			<div flex translate>{{$ctrl.tillData.storesDetail_storeName}}</div>\r\n			<div><span translate>Till</span>: {{$ctrl.tillData.tillsDetail_tillNumber}}</div>\r\n		</div><!--End Info-->\r\n	</center><!--End InvoiceTop-->\r\n    \r\n	<div calss=\"mid\">\r\n		<div class=\"info\">\r\n			<h2 translate>Customer Info</h2>\r\n			<p data-ng-repeat=\"customer in $ctrl.receipt.usersIdsalesHeaderId\"> \r\n				<span translate>Name</span> : {{customer.usersIdsalesHeaderId_firstName}} {{customer.usersIdsalesHeaderId_lastName}}</br>\r\n				<span translate>Email</span>   : {{customer.usersIdsalesHeaderId_email}}</br>\r\n				<span translate>Phone</span>   : {{customer.usersIdsalesHeaderId_cellphone}}\r\n			</p>\r\n		</div>\r\n	</div><!--End Invoice Mid-->\r\n    \r\n	<div calss=\"bot\">\r\n		<div calss=\"table\">\r\n			<table>\r\n				<tr class=\"tabletitle\">\r\n					<td class=\"item\"><h2 translate>Item</h2></td>\r\n					<td class=\"Hours\"><h2 translate>Qty</h2></td>\r\n					<td class=\"Rate\"><h2 translate>Total</h2></td>\r\n				</tr>\r\n				\r\n				<tbody data-ng-repeat=\"item in $ctrl.receipt.salesItem\" data-ng-if=\"item.itemsDetail_itemName\">\r\n					<tr ng-class=\"{\'service\': !item.salesItem_discount.length}\">\r\n						<td class=\"tableitem\"><p class=\"itemtext\"><span translate>{{item.itemsDetail_itemName}}</span><br />@{{item.itemsPrice_price}}</p></td>\r\n						<td class=\"tableitem\"><p class=\"itemtext\">{{item.salesItem_quantity}}</p></td>\r\n						<td class=\"tableitem\"><p class=\"itemtext\">{{item.itemsPrice_price * item.salesItem_quantity}}</p></td>\r\n					</tr>\r\n					<tr data-ng-if=\"item.salesItem_discount.length\" data-ng-repeat=\"discount in item.salesItem_discount\">\r\n						<td class=\"tableitem\">\r\n							<p class=\"itemtext\" translate>\r\n								{{discount.salesItemDiscount_markdownDescription || discount.salesItemDiscount_promotionName}}\r\n							</p>\r\n						</td>\r\n						<td>\r\n							{{discount.salesItemDiscount_precent ? discount.salesItemDiscount_precent+\'%\' : discount.salesItemDiscount_amount}} @{{discount.salesItemDiscount_basePrice}}\r\n						</td>\r\n						<td class=\"tableitem\">\r\n							<p class=\"itemtext\">\r\n								{{(-1) * discount.salesItemDiscount_amount}}\r\n							</p>\r\n						</td>\r\n					</tr>\r\n					<tr class=\"service\" data-ng-if=\"item.salesItem_discount.length\">\r\n						<td class=\"tableitem\" colspan=\"2\">\r\n							\r\n						</td>\r\n						<td class=\"tableitem\">\r\n							{{item.salesItem_afterDiscount}}\r\n						</td>\r\n					</td>\r\n				</tbody>\r\n			</table>\r\n			<table>\r\n				<tr class=\"tabletitle\">\r\n					<td translate>Total</td>\r\n					<td class=\"Rate\">@ {{$ctrl.receipt.total.totalQty}}</td>\r\n					<td class=\"payment\"><h2>{{$ctrl.receipt.total.totalPrice}}</h2></td>\r\n				</tr>\r\n			</table>\r\n			<table>\r\n				<tr class=\"tabletitle\" data-ng-repeat=\"saleDiscount in $ctrl.receipt.salesDiscount\">\r\n					<td class=\"item\" translate>Discount</td>\r\n					<td class=\"Rate\"><span translate>{{saleDiscount.salesHeaderDiscount_markdownDescription}}</span> @{{saleDiscount.salesHeaderDiscount_basePrice}}</td>\r\n					<td class=\"payment\">{{(-1) * saleDiscount.salesHeaderDiscount_amount}}</td>\r\n				</tr>\r\n			</table>\r\n			<table>\r\n				<tr class=\"tabletitle\">\r\n					<td colspan=\"2\" translate>Total Discount</td>\r\n					<td class=\"payment\"><h2>{{(-1) * $ctrl.receipt.total.totalDiscount}}</h2></td>\r\n				</tr>\r\n				<tr class=\"tabletitle\">\r\n					<td colspan=\"2\" translate>Total After Discount</td>\r\n					<td class=\"payment\"><h2>{{$ctrl.receipt.total.totalAfterDiscount}}</h2></td>\r\n				</tr>\r\n			</table>\r\n			<table>\r\n				<tr class=\"tabletitle\" data-ng-repeat=\"tax in $ctrl.receipt.salesTax\">\r\n					<td class=\"item\" translate>{{tax.salesHeaderTax_taxName}}</td>\r\n					<td class=\"Rate\">{{tax.salesHeaderTax_taxPercent}}% @{{tax.salesHeaderTax_taxBase}}</td>\r\n					<td class=\"payment\"><h2>{{tax.salesHeaderTax_taxAmount}}</h2></td>\r\n				</tr>\r\n			</table>\r\n			<table>\r\n				<tr class=\"tabletitle\">\r\n					<td colspan=\"2\" translate>Total After Tax</td>\r\n					<td class=\"payment\"><h2>{{$ctrl.receipt.total.totalAfterTax}}</h2></td>\r\n				</tr>\r\n			</table>\r\n		</div><!--End Table-->\r\n		<div  calss=\"table\">\r\n			<table>\r\n				<tr>\r\n					<td style=\"width:100%;\">\r\n						<div class=\"legalcopy\">\r\n							<p class=\"legal\"><strong translate>Thank you for your business!</strong>  <span translate>All sales are final</span> \r\n							</p>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</table>\r\n		</div>\r\n		<div class=\'barcodeHolder\'>\r\n			<div class=\'image\'><ng-barcode ng-barcode-input=\"{{$ctrl.receipt.salesHeader_offlineSalesId}}\" ng-barcode-code=\"code39\"></ng-barcode></div>\r\n			<div class=\'text\'>{{$ctrl.receipt.salesHeader_offlineSalesId}}</div>\r\n		</div>\r\n	</div><!--End InvoiceBot-->\r\n</div><!--End Invoice-->','[]','2019-07-31 03:12:48','',''),(10,'openPageInModal0','<md-dialog aria-label=\"Details\" flex>\r\n	<md-toolbar flex>\r\n		<div class=\"md-toolbar-tools\">\r\n			<span flex translate>{{$ctrl.title}}</span>\r\n			<md-button class=\"md-icon-button\" data-ng-if=\"$ctrl.showActionButtons\" data-ng-click=\"$ctrl.clickToSave()\">\r\n				<md-icon aria-label=\"Save Modal\" md-font-icon=\"check_circle\">check_circle</md-icon>\r\n			</md-button>\r\n			<md-button class=\"md-icon-button\" data-ng-click=\"$ctrl.clickToClose()\">\r\n				<md-icon aria-label=\"Close Modal\" md-font-icon=\"close\">close</md-icon>\r\n			</md-button>\r\n		</div>\r\n	</md-toolbar>\r\n	<md-dialog-content flex=\"noshrink\">\r\n		<div ui-view=\"modal0\"></div>\r\n	</md-dialog-content>\r\n</md-dialog>','[]','2019-06-28 01:22:10','',''),(11,'openPageInModal1','<md-dialog aria-label=\"Details\" flex>\r\n	<md-toolbar flex>\r\n		<div class=\"md-toolbar-tools\">\r\n			<span flex translate>{{$ctrl.title}}</span>\r\n			<md-button class=\"md-icon-button\" data-ng-if=\"$ctrl.showActionButtons\" data-ng-click=\"$ctrl.clickToSave()\">\r\n				<md-icon aria-label=\"Save Modal\" md-font-icon=\"check_circle\">check_circle</md-icon>\r\n			</md-button>\r\n			<md-button class=\"md-icon-button\" data-ng-click=\"$ctrl.clickToClose()\">\r\n				<md-icon aria-label=\"Close Modal\" md-font-icon=\"close\">close</md-icon>\r\n			</md-button>\r\n		</div>\r\n	</md-toolbar>\r\n	<md-dialog-content flex=\"noshrink\">\r\n		<div ui-view=\"modal1\"></div>\r\n	</md-dialog-content>\r\n</md-dialog>','[]','2019-06-28 01:22:04','',''),(12,'openPageInModal2','<md-dialog aria-label=\"Details\" flex>\r\n	<md-toolbar flex>\r\n		<div class=\"md-toolbar-tools\">\r\n			<span flex translate>{{$ctrl.title}}</span>\r\n			<md-button class=\"md-icon-button\" data-ng-if=\"$ctrl.showActionButtons\" d